import React from "react";
import "./UserLink.css";
import "./../../App.css";
import Parse from "parse";

import { Link } from "react-router-dom";

export default function ChatLink(props) {
  function handleClickChatLink() {
    const chatObject = props.chat;
    const usersInChat = chatObject.get("users");
    const receiver = null;
    usersInChat.forEach((user) => {
      if (user !== Parse.User.current()) {
        receiver = user;
      }
    });
    console.log("chatObject", chatObject);
    console.log("usersInChat", usersInChat);
    //   props.setSelectedUser()
  }

  return (
    <div>
      <Link to={props.to} onClick={handleClickChatLink}>
        <img
          className="user-link-add"
          src={require("./../../graphics/add_idle.png")}
          alt="Tripster Logo"
          height="40"
          width="40"
        ></img>
        <img src={props.photo} className="userlink-image" />
        <div className="user-link-username">
          <div className="body">{receiver}</div>
        </div>
        <div className="userlink-description">
          <div className="header">{props.nationality}</div>
          <div>{props.status}</div>
        </div>
      </Link>
    </div>
  );
}
